import React from 'react'
import styled from "styled-components";
import {
  space,
  SpaceProps,
  color,
  ColorProps,
  typography,
  TypographyProps,
  border,
  BorderProps,
  shadow,
  ShadowProps,
  layout,
  LayoutProps,
  position,
  PositionProps,
  compose,
} from "styled-system";

export type StyleProps = SpaceProps &
  ColorProps &
  TypographyProps &
  BorderProps &
  ShadowProps &
  LayoutProps &
  PositionProps;

const css = compose(space, color, typography, border, shadow, layout, position);

const BaseBox = styled('div')``

function Box({sx, ...rest}:StyleProps){
  return(
    <BaseBox sx={{
      ...sx
    }}
    {...rest}
    />
  )
}

Box.displayName = 'Box'

export default Box
